import React from 'react';
import Main from '../../paginas/main'
import Ponto from '../../paginas/ponto'
import Salarios from '../../paginas/salarios'
import Demonstrativo from '../../paginas/demonstrativo'
import 'react-native-gesture-handler';
import Icon from 'react-native-vector-icons/MaterialIcons';
import { createDrawerNavigator, DrawerContentScrollView, DrawerItemList, DrawerItem } from '@react-navigation/drawer'
import { StackActions } from '@react-navigation/native';
import {
  
  useWindowDimensions,
  
} from 'react-native';
  

const Drawer = createDrawerNavigator();



export default function Navegador({ navigation }) {


  return (
    <Drawer.Navigator initialRouteName="Dados Iniciais" drawerContent={props => {

      return (
        <DrawerContentScrollView {...props}>
          <DrawerItemList {...props} />
          
          <DrawerItem label="Sair"
            style={ { backgroundColor: 'red'}}
            labelStyle={{ color: "white", fontSize: 16, fontWeight: 'bold', marginLeft: 40 }}
            onPress={ () => {navigation.dispatch(
              StackActions.popToTop()
            );
            
            }}
          />
        </DrawerContentScrollView>
      )

    }}

      drawerStyle={{
        backgroundColor: "#313131",
        paddingVertical: 10
      }}

      screenOptions={{
        drawerType: 'front',
        activeBackgroundColor: "#fff",
        inactiveTintColor: "#fff",
        headerShown: false
      }}
    >

      <Drawer.Screen name="Dados Iniciais" component={Main}
        options={
          {
            drawerIcon: (({ focused }) => <Icon color={focused ? '#313131' : '#fff'} name="home" />)
          }
        }
      />
      <Drawer.Screen name="Ponto do Dia" component={Ponto}
        options={
          {
            drawerIcon: (({ focused }) => <Icon color={focused ? '#313131' : '#fff'} name="home" />)
          }
        }
      />
      <Drawer.Screen name="SÃ¡larios" component={Salarios}
        options={
          {
            drawerIcon: (({ focused }) => <Icon color={focused ? '#313131' : '#fff'} name="home" />)
          }
        }
      />
      <Drawer.Screen name="Demonstrativo" component={Demonstrativo}
        options={
          {
            drawerIcon: (({ focused }) => <Icon color={focused ? '#313131' : '#fff'} name="home" />)
          }
        }
      />


    </Drawer.Navigator>
  )
}
